// React Component (ContractPage.js)
import { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./contract.css";

function ContractPage() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    jobId: "",
    salary: "",
    probation: "",
    startDate: "",
    endDate: "",
    benefits: "",
  });

  const handleChange = (e) => {
    setFormData((prevData) => ({
      ...prevData,
      [e.target.name]: e.target.value,
    }));
  };

  const handleSubmit = async () => {
    try {
      const response = await fetch("http://localhost:5000/api/contract", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });
      
      const data = await response.json();
      alert(data.message);
    } catch (error) {
      console.error("Submission Error:", error);
      alert("Failed to submit contract");
    }
  };

  return (
    <div className="contract-page-container">
      <button className="contract-back-button" onClick={() => navigate(-1)}>
        Back
      </button>
      <h2>Contract</h2>
      <div className="contract-content">
        <div className="contract-form">
          <label>Job ID</label>
          <select name="jobId" value={formData.jobId} onChange={handleChange}>
            <option value="" disabled>Select Job ID</option>
            <option value="101">101</option>
            <option value="102">102</option>
          </select>

          <label>Salary</label>
          <select name="salary" value={formData.salary} onChange={handleChange}>
            <option value="" disabled>Select Salary</option>
            <option value="50000">$50,000</option>
            <option value="60000">$60,000</option>
          </select>

          <label>Probation Period</label>
          <select name="probation" value={formData.probation} onChange={handleChange}>
            <option value="" disabled>Select Probation Period</option>
            <option value="3">3 months</option>
            <option value="6">6 months</option>
          </select>

          <label>Contract Start Date</label>
          <input type="date" name="startDate" value={formData.startDate} onChange={handleChange} />

          <label>Contract End Date</label>
          <input type="date" name="endDate" value={formData.endDate} onChange={handleChange} />

          <label>Benefits</label>
          <select name="benefits" value={formData.benefits} onChange={handleChange}>
            <option value="" disabled>Select Benefits</option>
            <option value="Health Insurance">Health Insurance</option>
            <option value="Yearly Bonus">Yearly Bonus</option>
          </select>
        </div>
        <div className="contract-details">
          <h3>Selected Job Details</h3>
          <textarea readOnly value={JSON.stringify(formData, null, 2)} />
        </div>
      </div>
      <button className="contract-submit-button" onClick={handleSubmit}>
        Submit
      </button>
    </div>
  );
}
export default ContractPage;
